import React, { Component } from 'react';

class Nav extends Component {
  render () {
    return (
      <div className="nav">
        <div className="nav-logo">
          SPM Analyzer
        </div>
        <div className="nav-menu">
          <ul className="nav-menu-list">
            <li className="nav-menu-list-item">Home</li>
            <li className="nav-menu-list-item">Features</li>
            <li className="nav-menu-list-item">Gallery</li>
            <li className="nav-menu-list-item">SPM Estimator</li>
            <li className="nav-menu-list-item">Contact</li>
            <li className="nav-menu-list-item-download">Download</li>
          </ul>
        </div>
      </div>
    )
  }
}
export default Nav
